import React from 'react';
import '../css/Filter.css';
const Filter = () => {
	return (
		<div className='Filter--comp'>

			<li className='filter__list-item'>all todos</li>
			<li className='filter__list-item'>waitings</li>
			<li className='filter__list-item'>inprogresses</li>
			<li className='filter__list-item'>completed</li>


		</div>
	);
};

export default Filter;
